    private void OnEmulatorRun( object sender, DoWorkEventArgs e )
    {
      m_Emulator.Machine.HardReset();

      try
      {
        while ( m_EmulatorRunning )
        {
          while ( m_Emulator.State == EmulatorState.RUNNING )
          {
            m_Emulator.RunCycles( 1 );
          }
          if ( m_Emulator.State == EmulatorState.STOPPED )
          {
            if ( !m_EmulatorPaused )
            {
              m_EmulatorPaused = true;
              Text += " - Paused";
            }
          }
        }
      }
      catch ( Exception ex )
      {
        Debug.Log( "Exception: " + ex );
      }
    }



